import React from 'react';
import './footer.css';
import Email from './images/email.png';
import GitHub from './images/GitHub.png';
import LinkedIN from './images/LinkedIn.png'

class Footer extends React.Component {
    render() {
        const GitHubLink = "https://github.com/Dloft1991"

        return (

            <div className="ftr-main">
                <ul>
                    <li><a href=""><img src={GitHub} href={GitHubLink}></img></a></li>
                    <li><a href="https://www.linkedin.com/in/derek-lofton-27920699/" target="_blank">LinkedIN</a></li>
                    <li><a href="mailto:derek.r.lofton@gmail.com" target="_blank">Email</a></li>
                </ul>
            </div>
        )
    }
}




export default Footer;
